import {API_URL2} from '../Config/Config';


const fetchSearchData = value => {
 const newValue = encodeURI(value)
 const url = [`${API_URL2}/search?q=${newValue}&media_type=image`]
 return fetch(url).then(response => response.json());
}

export default fetchSearchData;
